import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

import AddProduct from "./component/AddProduct";
function App() {
  <BrowserRouter>
  return <Route path="/AddProduct" component={AddProduct}></Route>;
  </BrowserRouter>
}

export default App;
